import React, { Component } from 'react'; 
import { Link } from 'react-router-dom'; 
import { Form  } from 'react-bootstrap'; 



export class Categories extends Component {
    render() {
        return (
            <div class="row d-flex justify-content-between mx-4 mb-3">
                <h3> All Products</h3>
                <div class="row justify-content-around">
                    <Form.Group>
                        <div className="input-group">
                            <Form.Control type="text" className="form-control" placeholder="Recipient's username" aria-label="Recipient's username" aria-describedby="basic-addon2" />
                            <div className="input-group-append">
                                <button className="btn btn-sm btn-gradient-primary" type="button">Search</button>
                            </div>
                            <Link to="/product/add">
                                <button type="button" className="btn btn-gradient-primary btn-md">+ add new product</button>
                            </Link>
                        </div>
                    </Form.Group>
                </div>
            </div>
        )
    }
}

export default Categories;
